import React from 'react'
import logoSrc from '../assets/logo.png';
import styled from 'styled-components';


const LogoImage  = styled.div`
    width: 40px;
    height: 40px;
`;

const Logo = () => {
    return (
        <div>
            <LogoImage src={logoSrc} alt="ULTEAM"/>
        </div>
    )
}

export default Logo
